desista dos seus sonhos mesmo que pare\u00e7am imposs\u00edveis s\u00e3o seus, ent\u00e3o lute por eles. N\u00e3o deixe essas tentativas frustradas te parar voc\u00ea \u00e9 forte, inteligente, incr\u00edvel e capaz. Se n\u00e3o conseguiu na primeira tentativa, tente outras mil, s\u00f3 n\u00e3o desista. \nA cada novo amanhecer, voc\u00ea ganha uma nova chance de tentar. \"H\u00e1...mais eu j\u00e1 tentei tanto\", \"E se eu n\u00e3o conseguir!?\" , \"Eu n\u00e3o consigo\", \"Eu estudei, mas fulano \u00e9 inteligente\".\nPara! Chega disso tudo, \"eu n\u00e3o consigo\", \"eu n\u00e3o posso\", \"ele sabe mais\". N\u00e3o, isso n\u00e3o existe todos somos capazes, basta termos persist\u00eancia e determina\u00e7\u00e3o. \nSomos ser humanos cada um diferente do outro, para uns conquistar seus sonhos pode levar apenas alguns meses, para outros anos, mas todos eles conseguem n\u00e3o importa o tempo, mas sim a vontade de vencer e conseguir realiz\u00e1-los.\nNunca desista dos seus sonhos! \ud83d\udcab\n.#fotografia#emotivo\nBy:@estefany__aguiar \nBy:@li_alves01\n#photograpy\n#photo\n#textos\n#emo\u00e7\u00e3o\n#paz\n#motiva\u00e7\u00e3o\n#ps_fotografias #followers #fff #f4f #f4follow #desflopforfcs #Love #cute #like #sdv #likeforlikes #like4likes #lovemy #followtrick #style #follow #followme #l4l #desflopforfcs #desflop #follow #instagram #seguidoreshashtag #follow4followback #followers"}}]},"shortcode":"B9tdEiQBJX8","edge_media_to_comment":{"count":3},"taken_at_timestamp":1584180668,"dimensions":{"height":800,"width":640},"display_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/89863185_1542993552536723_1956862361210764279_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=111\u0026_nc_ohc=wX7WDN5zjTkAX_Y1GG_\u0026oh=814fdee80235508a0e9bfc4c265253cb\u0026oe=5EA5A498","edge_liked_by":{"count":55},"edge_media_preview_like":{"count":55},"owner":{"id":"9791697179"},"thumbnail_src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/c0.63.501.5 om/v/t51.2885-15/e35/c0.166.1440.1440a/s320x320/89828314_2991464204239234_8747334136652265237_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=110\u0026_nc_ohc=H-7ICMcpABwAX8dGQDW\u0026oh=069df4b8ab13b4e5238f3edd9cd2a8b3\u0026oe=5E9EA296","config_width":320,"config_height":320},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/c0.166.1440.1440a/s480x480/89828314_2991464204239234_8747334136652265237_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=110\u0026_nc_ohc=H-7ICMcpABwAX8dGQDW\u0026oh=5bc72e4f2fb744914ffd89aa5900b34f\u0026oe=5E9DDFD1","config_width":480,"config_height":480},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/sh0.08/e35/c0.166.1440.1440a/s640x640/89828314_2991464204239234_8747334136652265237_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=110\u0026_nc_ohc=H-7ICMcpABwAX8dGQDW\u0026oh=a3a3898f63bf1d582c3ce73a2a380e09\u0026oe=5E9F04DE","config_width":640,"config_height":640}],"is_video":false,"accessibility_caption":"\u56fe\u7247\u4e2d\u53ef\u80fd\u6709\uff1a1 \u4f4d\u7528\u6237\u3001\u7ad9\u7acb\u548c\u5ba4\u5185"}},{"node":{"__typename":"GraphImage","id":"2265607742727181452","edge_media_to_caption":{"edges":[{"node":{"text":"Life is tough \nbut so are you.\n\n\u00dcberall herrscht das selbe Thema. Wo ich auch hinschaue, erinnern mich entweder be\u00e4ngstigend leere Regale oder schimpfende Menschen an diesen unsichtbaren Gegner, der unseren Alltag mal eben auf den Kopf gestellt hat.\n\nAls sich das Virus vor einigen Wochen auszubreiten begann, habe ich mich ganz bewusst mit den Vorg\u00e4ngern der Krankheit auseinandergesetzt und da mein Vater aus der Lebensmittelbranche kommt, konnte ich mich auch noch gut an die Zeiten der Schweine-oder Vogelgrippe erinnern. So war mir also schon vor Wochen ziemlich klar, was hier auf uns zukommen d\u00fcrfte. Vor ein paar Wochen - als man noch als panisch oder l\u00e4cherlich abgestempelt wurde.\n\nIch hoffe, dass wir sp\u00e4testens jetzt verstehen, dass Witze und Verharmlosung nicht mehr angebracht sind. Auf meinem Profil m\u00f6chte ich euch aber weiterhin mit meinen Posts auf positivere Gedanken bringen und werde mich also vermutlich nur dieses eine Mal so umfangreich zu diesem Thema \u00e4u\u00dfern. \nIch finde, jeder sollte selbst entscheiden, ob er \u00fcber Instagram noch mehr Infos oder Ablenkung finden will und kann demnach entscheiden, welche Profile gerade das teilen, was man sucht. Ich f\u00fcr meinen Teil, w\u00fcrde gerne weiterhin vor allem Positives mit euch teilen.\n\nMein gr\u00f6\u00dfter Respekt gilt aber allen, die in dieser Zeit f\u00fcr unsere Gesundheit arbeiten und ich w\u00fcnsche allen Kraft, die sich in Quarant\u00e4ne befinden, krank sind oder einen Verlust erfahren mussten.\n\nEin paar Reisen weniger, ein bisschen Egoismus weniger und ein Gedanke mehr an unsere Mitmenschen k\u00f6nnen in dieser Zeit ein kleines Wunder bewirken. \u2764\ufe0f\u2764\ufe0f\u2764\ufe0f \u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\n#quarant\u00e4ne #motivation #f\u00fcrmehrrealit\u00e4taufinstagram \n#spirituality #glowpro #positivevibes  #travelgirl #travelblogger #carmushka #cute #girly #flower #beach #summer #selflove #springfashion #makeupinspo #anajohnson #springinspo #fashioninspo #glitteriingdreams #prettylittleiiinspo #germanbloggergirls #blogger_de #americanstyle #blondesandcookies"}}]},"shortcode":"B9xDj0BoNSM","edge_media_to_comment":{"count":62},"taken_at_timestamp":1584301511,"dimensions":{"height":1350,"width":1080},"display_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/89735805_1694817803992689_5519971834049748128_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=109\u0026_nc_ohc=TJx6o-8y1H4AX8BpJHy\u0026oh=7d23f855a1d5441b726650a0fe4b83d9\u0026oe=5E9D8ACC","edge_liked_by":{"count":368},"edge_media_preview_like":{"count":368},"owner":{"id":"2905
